import React from 'react';
import {Container} from "./styles";
import pessoa from '../assets/pessoa.jpg';

const Home = () => {
    return (
        <Container>
            <div className={'image'}>
                <img src={pessoa}/>
            </div>
        </Container>
    );
};

export default Home;
